	function setup_social_share_widget(){
		if($('.post_container').length > 0){
			current_top = $('.post_container').offset().top;
			current_left = $('.share_post_widet').offset().left;
			widget_height = $('.share_post_widet').height();
			diff = current_top - $(window).scrollTop();
			post_bottom = $('.post_container').height() + $('.post_container').offset().top - widget_height - 210;
			if (diff <= 150){
				if(post_bottom <= $(window).scrollTop()){
					$('.share_post_widet').removeClass('fixed_widget').addClass('bottom_widget');
					$('.share_post_widet').removeAttr('style');
				}else{
					$('.share_post_widet').addClass('fixed_widget').removeClass('bottom_widget');
					$('.share_post_widet').css('left', current_left).css('top', 150);
				}
			}else if($('.share_post_widet').hasClass('fixed_widget')){
				$('.share_post_widet').removeClass('fixed_widget');
				$('.share_post_widet').removeAttr('style');
			}
		}
	}

